import React, { useEffect, useState } from 'react'

const Test = () => {

    const [countn, setCountn] = useState(0);

    useEffect(()=>{
        console.log('Hello World');
        if(countn == 0){
            document.title = `Chats`
        } else{
            document.title = `Chats (${countn})`
        }

    },[countn]);

    return (
        <div>
            <h1>{countn}</h1>
            <button onClick={() => setCountn(countn + 1)}>Click me</button>
        </div>
    )
}

export default Test
